from typing import final


starting_pose = ""
final_pose = ""

assert(len(starting_pose) == len(final_pose))
difference = 0
total = 0
for idx in range(0,len(starting_pose)):
    if starting_pose[idx] != final_pose[idx]: 
        difference += 1
    total += 1

print("Percentage difference in the seq is: ", difference * 100 /total)